  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'appImobiliariaAng';
}
<div class="content">
  <app-card-house></app-card-house>
  <app-result-house></app-result-house>
</div>
